import React from 'react';
import { NavLink, Link } from 'react-router-dom';

function Header() {
  const clickStyle = { color: 'red' };

  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      section.scrollIntoView({
        behavior: 'smooth',
      });
    }
  };

  const handleClick = (to, sectionId) => {
    if (to === '/react_portfolio') {
      // Handle logic for "Branden Min" link
      scrollToSection(sectionId);
    } else {
      window.open(to, '_black');
    }
  };

  return (
    <header>
      <meta
        name="viewport"
        content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0"
      />
      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css"
      />
      <div className="inner">
        <h1 className="logo">
          <Link to="/react_portfolio" onClick={() => handleClick('/react_portfolio', 'headline')}>
            Branden Min
          </Link>
        </h1>
        <ul className="gnb">
          <li>
            <button onClick={() => handleClick('/react_portfolio#headline', 'headline')}>About</button>
          </li>
          <li>
            <button onClick={() => handleClick('/react_portfolio#projects', 'projects')}>PROJECTS</button>
          </li>
          <li>
            <button onClick={() => handleClick('/react_portfolio#experiences', 'experiences')}>EXPERIENCES</button>
          </li>
          <li>
            <button onClick={() => handleClick('/react_portfolio#skills', 'skills')}>SKILLS</button>
          </li>
          <li>
            <Link to="/Cv" onClick={() => handleClick('/react_portfolio/BrandenMin.pdf', 'cv')}>
              CV
            </Link>
          </li>
        </ul>
        <div className="snsContact">
          <a href="https://www.linkedin.com/in/brandenmin/" target="_blank">
            <i className="fa-brands fa-linkedin"></i>
          </a>
          <a href="https://github.com/Gemnnn" target="_blank">
            <i className="fa-brands fa-github"></i>
          </a>
          <a href="#">
            <i className="fa-brands fa-facebook"></i>
          </a>
        </div>
      </div>
    </header>
  );
}

export default Header;
